styles:
div.tooltip::before {
    content: attr(data-tip) ;   

    font-size: 10px;
    position:absolute;
    z-index: 999;
    white-space:nowrap;
    bottom:9999px;
    left: 50%;
    background:#00ce9f;
    color:#e0e0e0;
    padding:0px 7px;
    line-height: 24px;
    height: 24px;
    opacity: 0;  
    transition:opacity 0.4s ease-out; 
    }

    div.tooltip:hover::before {
        opacity: 1;
        bottom:-35px;
        border-radius: 25px;
    }

    .selling-point-name {
        padding-bottom: 0.5em;
        font-size: 0.8em;
        color: #333;
        text-align: center; 
    }

    .occupation-indicator {
        position: relative;
        margin: 1em auto 0; 
        width: 50px;
        height: 50px; 
    }

    .occupation-ring {
        position: absolute;
        top: 50%;
        left: 50%;
        -webkit-transform: translate(-50%, -50%);
        -moz-transform: translate(-50%, -50%);
        -ms-transform: translate(-50%, -50%);
        -o-transform: translate(-50%, -50%);
        transform: translate(-50%, -50%);
        border: 1px solid #f89a80;
        border-radius: 100%; 
    }

